import axios from "axios";
const URL = "http://localhost:3001";


export const validateEmail = async email => {
  try {
    const res = await axios.get(`${URL}/validateEmail`, {
      params: { email: "moral@gmail.com" }
    });

    console.logg("show");
  } catch (error) {
    console.log(error);
  }
};
